After months of trying, I give you a leaning tower of matcha macarons with strawberry french buttercream.

üåø Matcha Macaron Shell
108g egg whites
81g granulated sugar
1/4 tsp cream of tartar
107g almond flour
171g powdered sugar
1 1/2 tbsp matcha powder

Sift almond flour, powdered sugar, and matcha together at least twice. Use egg whites, granulated sugar, and cream of tartar to make a french meringue. Sift dry ingredients over the meringue and then fold gently until you can draw a figure 8 or two with the batter running off your spatula. Bake at 300¬∞F for 14-17 minutes.

üçì Strawberry French Buttercream
2 egg yolks
50g granulated sugar
3 1/2 tbsp milk
12 tbsp butter
Strawberry jam (to taste)

Combine egg yolks, sugar, and milk in a sauce pan on low heat while stirring constantly until it resembles the consistency of pudding. Let cool and then use a mixer to beat the butter in until smooth, then add jam. If buttercream is too runny, add a little powdered sugar to stabilize.
.
